import "./App.css";
import { BrowserRouter } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <h1>hello world!</h1>
      </div>
    </BrowserRouter>
  );
}

export default App;
